pragma solidity >=0.4.22 <0.9.0;

contract SpaceY {
    struct Planet {
        address owner;
        uint64 units;
    }

    struct PlanetStats {
        uint64 unitsCost;
        uint64 unitsCreationPerSecond;
    }

    uint16 public size;

    mapping(uint32 => Planet) planets;

    constructor(uint16 universeSize) public {
        size = universeSize;
    }

    modifier ownsPlanet(uint32 planet_id, address person) {
        require(planets[planet_id].owner == msg.sender, "Not owning planet");
        _;
    }

    event PlanetConquered(uint32 planet_id, address indexed new_owner);

    function getPlanetStats(uint32 planet_id)
        public
        view
        returns (uint64 unitsCost, uint64 unitsCreationPerSecond)
    {
        uint64 magnitute = ((1 / size) * planet_id - size) ^ 2;
        bytes32 hash_factor = keccak256(abi.encode(planet_id + magnitute));

        return (
            magnitute + ((magnitute * uint8(hash_factor[0])) % magnitute),
            (magnitute + uint8(hash_factor[1])) % magnitute
        );
    }

    function moveUnits(
        uint32 from_planet_id,
        uint32 to_planet_id,
        uint64 unit_amount
    )
        public
        ownsPlanet(to_planet_id, msg.sender)
        ownsPlanet(from_planet_id, msg.sender)
    {}
}
